import React, { Component } from "react";

class Page extends Component {
  constructor(props) {
    super(props);
    this.state = {
      styles: {
        color: "red",
        width: "100vw",
        height: "100vh"
      }
    };
  }

  render() {
    return <div style={this.state.styles} />;
  }
}

export default Page;
